import React, { useState } from 'react'
import BigImg from './BigImg';
import './Gallery.css';

const Gallery = () => {
    const images = [
        {img: "data:image/png;base64,"},
        {img: "data:image/png;base64,"},
        {img: "data:image/png;base64,"},
        {img: "data:image/png;base64,"},
        {img: "data:image/png;base64,"},
        {img: "data:image/png;base64,"},
        {img: "data:image/png;base64,"},
        {img: "data:image/png;base64,"},
        {img: "data:image/png;base64,"},
        {img: "data:image/png;base64,"},
        {img: "data:image/png;base64,"},
    ]
    const [big, setBig] = useState();
    const makeBig = (img) => {
        setBig(img.target.src)
    }
    return (
        <div>
            <div className="title">
                Gallery
            </div>
            <section className="gallery__imgs">
                {images.map(el => {
                    return (
                    <div onClick={makeBig}>
                        <img className="gallery__img" src={el.img} art="#" />
                    </div>)
                    }
                )}
            </section>
            <BigImg big={big} />
        </div>
    )
}
export default Gallery;